c viên Ứng dụng quản lý thông tin học viên DOTB SEA</span></p>\r\n<p><span style=\"font-size:small;\">Trải nghiệm ứng dụng ngay hôm nay</span></p>\r\n<p><span style=\"font-size:small;\">IOS: <a href=\"https://apps.apple.com/us/app/dotb-crm/id1475488445?fbclid=IwAR2OVKqPuWqXl_iYO-9Lkqp_h_gzqkxPpNF_SBvIp68zfrd0TlKVb6NCcfA\">https://apps.apple.com/us/app/dotb-crm/id1475488445</a>…</span><br /><span style=\"font-size:small;\">Android: <a href=\"https://play.google.com/store/apps/details?id=vn.dotb.sea&amp;fbclid=IwAR3ImPTCtQpJ_W4ADq3UPXE1d3RHf4pHvgJkPw36Nrh0QtalNpp-ecNZoyM\">https://play.google.com/store/apps/details?id=vn.dotb.sea</a></span></p>\r\n<p><span style=\"font-family:verdana, geneva;font-size:small;\">Mọi thông tin có liên quan đến khóa học của bạn tại trung tâm sẽ được cung cấp trên Ứng dụng này (Ví dụ như: Kết quả khóa học của bạn, Tình trạng học phí và đặc biệt là sự liên kết đến hệ thống học online Elearning…)</span></p>\r\n<p><span style=\"font-family:verdana, geneva;font-size:small;\">Thông tin Tài khoản của quý học viên như sau:</span></p>\r\n<p><span style=\"font-family:verdana, geneva;font-size:small;\"><strong><em>                Tên người dùng: <span>$contact_contact_id,</span><strong style=\"font-family:verdana, geneva;font-size:small;\"><em><br /></em></strong></em></strong></span></p>\r\n<p><span style=\"font-family:verdana, geneva;font-size:small;\"><strong><em>                Mật khẩu: <strong style=\"font-family:verdana, geneva;font-size:small;\"><em><br /></em></strong></em></strong></span></p>\r\n<p><span style=\"font-family:verdana, geneva;font-size:small;\">Chúc quý học viên học tập hiệu quả!</span></p>\r\n<p><span style=\"font-family:verdana, geneva;font-size:small;\">Trân trọng!</span></p>',0,'Contacts','DotB EMS','do-not-reply@dotb.vn',0,'workflow',1,'1','1','1','',0,''),('6725a10d-55b1-f1a8-e952-56137d4f7e81','2015-10-06 07:52:54','2019-06-20 19:35:44','1','1','off','Chúc mừng sinh nhật','','','Trung Tam Anh Ngu $brand xin gui nhung l