INSERT INTO `folders` VALUES ('e63e55c2-5149-11ea-b206-00ff539a1f05','My Email','inbound',NULL,1,0,1,'SELECT emails.id polymorphic_id, \'Emails\' polymorphic_module FROM emails\r\n								   JOIN emails_text on emails.id = emails_text.email_id\r\n                                   WHERE (type = \'inbound\' OR status = \'inbound\') AND assigned_user_id = \'1\' AND emails.deleted = \'0\' AND status NOT IN (\'sent\', \'archived\', \'draft\') AND type NOT IN (\'out\', \'archived\', \'draft\')',NULL,'2ff2b672-48a3-11ea-bc13-00ff539a1f05','2ff2b672-48a3-11ea-bc13-00ff539a1f05',NULL,'1','1',0),('e65b0e88-5149-11ea-adde-00ff539a1f05','My Drafts','draft','e63e55c2-5149-11ea-b206-00ff539a1f05',0,0,1,'SELECT emails.id polymorphic_id, \'Emails\' polymorphic_module FROM emails\r\n								   JOIN emails_text on emails.id = emails_text.email_id\r\n                                   WHERE (type = \'draft\' OR status = \'draft\') AND assigned_user_id = \'1\' AND emails.deleted = \'0\' AND status NOT IN (\'archived\') AND type NOT IN (\'archived\')',NULL,'2ff2b672-48a3-11ea-bc13-00ff539a1f05','2ff2b672-48a3-11ea-bc13-00ff539a1f05',NULL,'1','1',0),('e65c414a-5149-11ea-9a51-00ff539a1f05','Sent Emails','sent','e63e55c2-5149-11ea-b206-00ff539a1f05',0,0,1,'SELECT emails.id polymorphic_id, \'Emails\' polymorphic_module FROM emails\r\n								   JOIN emails_text on emails.id = emails_text.email_id\r\n                                   WHERE (type = \'out\' OR status = \'sent\') AND assigned_user_id = \'1\' AND emails.deleted = \'0\' AND status NOT IN (\'archived\') AND type NOT IN (\'archived\')',NULL,'2ff2b672-48a3-11ea-bc13-00ff539a1f05','2ff2b672-48a3-11ea-bc13-00ff539a1f05',NULL,'1','1',0),('e65d5152-5149-11ea-b3ed-00ff539a1f05','My Archived Email','archived','e63e55c2-5149-11ea-b206-00ff539a1f05',0,0,1,NULL,NULL,'2ff2b672-48a3-11ea-bc13-00ff539a1f05','2ff2b672-48a3-11ea-bc13-00ff539a1f05',NULL,'1','1',0);
